  return (
    <>
       <Header/>
       <Container>
         <h1>this is a shop app</h1>
       </Container>
       <Row className="mx-0">
  <Button as={Col} variant="primary">Button #1</Button>
  <Button as={Col} variant="secondary" className="mx-2">Button #2</Button>
  <Button as={Col} variant="success">Button #3</Button>
</Row>
    </>
  );
}

export default App;
